      <wrapped id=\"71\">\n                  <parameterizable class=\"org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition\" id=\"72\" retired=\"false\">\n                    <parameters reference=\"4\"/>\n                    <query>SELECT p.patient_id FROM patient p WHERE p.date_created &gt;= :startDate AND p.date_created &lt;= :endDate </query>\n                  </parameterizable>\n                  <parameterMappings reference=\"17\"/>\n                </wrapped>\n              </parameterizable>\n              <parameterMappings reference=\"17\"/>\n            </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n          </rowFilters>\n        </parameterizable>\n        <parameterMappings reference=\"17\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, 'd71b5170-5283-11e7-b114-b2f933d5fe66'),
(6, 'List of Diagnosis', 'List all diagnosis''s for a given date range along with the count', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451ae04-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of Diagnosis</name>\n  <description>List all diagnosis&apos;s for a given date range along with the count</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2018-04-04 11:50:44 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>listOfDiagnosis</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" retired=\"false\">\n          <name>List of Diagnosis</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT cn.name as Diagnosis , count(*) as Count FROM  obs obs INNER JOIN concept_name cn ON obs.value_coded= cn.concept_id WHERE obs.concept_id = ( SELECT c.concept_id FROM concept c WHERE c.uuid=&apos;1284AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA&apos; ) AND cn.locale=&apos;en&apos; AND cn.locale_preferred = &apos;1&apos; AND obs.date_created &gt;= :startDate AND obs.date_created &lt;= :endDate group by obs.value_coded, cn.name order by count(*) desc ;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, 'e451ae04-4881-11e7-a919-92ebcb67fe33'),
(7, 'List of New Patient Registrations', 'List all patients who have registered within since a given date', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451a9d6-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of New Patient Registrations</name>\n  <description>List all patients who have registered within since a given date</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2018-04-04 11:50:44 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>newPatientRegistrations</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>List of New Patient Registrations</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT pi.identifier as OpenMRS_ID, pn.given_name as Given_Name, pn.family_name as Family_Name, p.date_created as Created FROM patient p INNER JOIN person_name pn ON p.patient_id = pn.person_id INNER JOIN patient_identifier pi ON p.patient_id = pi.patient_id WHERE p.date_created &gt;= :startDate ORDER BY p.patient_id desc </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, 'e451a9d6-4881-11e7-a919-92ebcb67fe33'),
(8, 'Number of Visit Notes', 'Number of active visit notes for a given time period', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"9667ac52-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Visit Notes</name>\n  <description>Number of active visit notes for a given time period</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2018-04-04 11:50:44 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>Visit Note Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" retired=\"false\">\n          <name>Number of Visit Notes</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Number_of_visit_notes from encounter e where e.encounter_type = (select et.encounter_type_id from encounter_type et where et.uuid = &apos;d7151f82-c1f3-4152-a605-2f9ea7414a79&apos;) and e.encounter_datetime &gt;= :startDate and e.encounter_datetime &lt;= :endDate and e.voided = 0 </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, '9667ac52-4881-11e7-a919-92ebcb67fe33'),
(9, 'List of Users', 'List all users who are active or retired in the system', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d3950d7c-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of Users</name>\n  <description>List all users who are active or retired in the system</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2018-04-04 11:50:44 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>retired</name>\n      <label>Retired Users</label>\n      <type>java.lang.Boolean</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>listOfUsers</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>List of Users</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select username as User , date_created as Created from users where retired = :retired; </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>retired</string>\n            <string>${retired}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, 'd3950d7c-4881-11e7-a919-92ebcb67fe33'),
(10, 'Number of Discharges', 'Number of Discharges for a given location', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"b39c5070-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Discharges</name>\n  <description>Number of Discharges for a given location</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2018-04-04 11:50:44 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>Discharge Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>Number of Discharges</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Count from encounter e where e.encounter_type=(select encounter_type_id from encounter_type where uuid=&apos;181820aa-88c9-479b-9077-af92f5364329&apos;) and e.location_id=:location and e.voided = 0 group by e.encounter_type </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-04-04 12:50:44', 2, NULL, NULL, 0, NULL, NULL, NULL, 'b39c5070-4881-11e7-a919-92ebcb67fe33'),
(12, 'Lab-LabReport', 'Export of all lab results in the lab form', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"1ecb3d1e-0572-4da9-b98f-aa1b47ed7c5e\" retired=\"false\">\n  <name>Lab-LabReport</name>\n  <description>Export of all lab results in the lab form</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-04-13 11:08:02 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-01 11:34:47 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>12</id>\n  <sqlQuery>select  &#xd;\n   patient.patient_id as PatientID,&#xd;\n   pid1.identifier as PepfarID,&#xd;\n   pid2.identifier as HospID,&#xd;\n   encounter.encounter_datetime as VisitDate,&#xd;\n   form.`name` as PmmForm,&#xd;\n   CONCAT(prs1.given_name,&apos; &apos;,prs1.family_name) as EnteredBy,&#xd;\n   encounter.date_created as DateCreated,&#xd;\n   MAX(IF(obs.concept_id= 162084, cn1.name, NULL)) as  `VisitType`&#xd;\n   ,MAX(IF(obs.concept_id= 165394, obs.value_text, NULL)) as `LabRegNo`&#xd;\n   ,MAX(IF(obs.concept_id= 5497, obs.value_numeric, NULL)) as  `CD4Count`&#xd;\n   ,MAX(IF(obs.concept_id= 856, obs.value_numeric, NULL)) as  `ViralLoad`&#xd;\n   ,MAX(IF(obs.concept_id= 730, obs.value_numeric, NULL)) as `cd4%`&#xd;\n   ,MAX(IF(obs.concept_id= 1132,  obs.value_numeric, NULL)) as `Na+`&#xd;\n   ,MAX(IF(obs.concept_id= 678, obs.value_numeric, NULL)) as `WBC`&#xd;\n   ,MAX(IF(obs.concept_id= 1133, obs.value_numeric, NULL)) as  `K+`&#xd;\n   ,MAX(IF(obs.concept_id= 1319, obs.value_numeric, NULL)) as `Lymphocytes`&#xd;\n   ,MAX(IF(obs.concept_id= 1338, obs.value_numeric, NULL)) as `Lymphocytes%`&#xd;\n   ,MAX(IF(obs.concept_id= 1134, obs.value_numeric, NULL)) as  `Cl-`&#xd;\n   ,MAX(IF(obs.concept_id= 1023, obs.value_numeric, NULL)) as `Monocytes`&#xd;\n   ,MAX(IF(obs.concept_id= 1339, obs.value_numeric, NULL)) as `Monocytes%`&#xd;\n   ,MAX(IF(obs.concept_id= 163596,obs.value_numeric, NULL)) as `HCO3`&#xd;\n   ,MAX(IF(obs.concept_id= 1022, obs.value_numeric, NULL)) as `Neutrophils`&#xd;\n   ,MAX(IF(obs.concept_id= 165919,obs.value_numeric, NULL)) as `Neutrophils%`&#xd;\n   ,MAX(IF(obs.concept_id= 1024, obs.value_numeric, NULL)) as `Eosinophils`&#xd;\n   ,MAX(IF(obs.concept_id= 1340, obs.value_numeric, NULL)) as  `Eosinophils%`&#xd;\n   ,MAX(IF(obs.concept_id= 160053,  obs.value_numeric, NULL)) as `SerumGlucose`&#xd;\n   ,MAX(IF(obs.concept_id= 1025,  obs.value_numeric, NULL)) as `Basophils`&#xd;\n   ,MAX(IF(obs.concept_id= 1341, obs.value_numeric, NULL)) as  `Basophils%`&#xd;\n   ,MAX(IF(obs.concept_id= 655, obs.value_numeric, NULL)) as `T.Bilirubin`&#xd;\n   ,MAX(IF(obs.concept_id= 165395, obs.value_numeric, NULL)) as `HB/PCV`&#xd;\n   ,MAX(IF(obs.concept_id= 165920, obs.value_numeric, NULL)) as  `Heamoglobin`&#xd;\n   ,MAX(IF(obs.concept_id= 1299, obs.value_numeric, NULL)) as `Amylase`&#xd;\n   ,MAX(IF(obs.concept_id= 729, obs.value_numeric, NULL)) as `PlatelateCount`&#xd;\n   ,MAX(IF(obs.concept_id= 1006, obs.value_numeric, NULL)) as `TotalCholesterol`&#xd;\n   ,MAX(IF(obs.concept_id= 159430, cn1.name, NULL)) as  `HepatitisBTestQualitative`&#xd;\n   ,MAX(IF(obs.concept_id= 1008, obs.value_numeric, NULL)) as `LDL`&#xd;\n   ,MAX(IF(obs.concept_id= 299,  cn1.name, NULL)) as `VDRL`&#xd;\n   ,MAX(IF(obs.concept_id= 1007,  obs.value_numeric, NULL)) as `HDL`&#xd;\n   ,MAX(IF(obs.concept_id= 164364,  obs.value_numeric, NULL)) as `Creatinine`&#xd;\n   ,MAX(IF(obs.concept_id= 654,  obs.value_numeric, NULL)) as `AST`&#xd;\n   ,MAX(IF(obs.concept_id= 165923,  obs.value_numeric, NULL)) as `ALT/SGPT`&#xd;\n   ,MAX(IF(obs.concept_id= 1009,  obs.value_numeric, NULL)) as `Triglycerides`&#xd;\n   ,MAX(IF(obs.concept_id= 159734,  cn1.name, NULL)) as  `GlucoseQualitativeUrine`&#xd;\n   ,MAX(IF(obs.concept_id= 1875, cn1.name, NULL)) as `UrineProtein`&#xd;\n   ,MAX(IF(obs.concept_id= 785,  obs.value_numeric, NULL)) as `AlkalinePhosphatase`&#xd;\n   ,MAX(IF(obs.concept_id= 165927, cn1.name, NULL)) as `Cytology`&#xd;\n   ,MAX(IF(obs.concept_id= 45, cn1.name, NULL)) as  `UrinePregnancyTest`&#xd;\n   ,MAX(IF(obs.concept_id= 262, cn1.name, NULL)) as `MalariaSmear`&#xd;\n   ,MAX(IF(obs.concept_id= 164980, cn1.name, NULL)) as `IndicationForViralLoadTest`&#xd;\n   ,MAX(IF(obs.concept_id= 164987,  obs.value_text, NULL)) as  `OrderedBy`&#xd;\n   ,MAX(IF(obs.concept_id= 164989,  obs.value_datetime, NULL)) as `DateOrdered`&#xd;\n   ,MAX(IF(obs.concept_id= 164982,  obs.value_text, NULL)) as `ReportedBy`&#xd;\n   ,MAX(IF(obs.concept_id= 165414, obs.value_datetime, NULL)) as `DateReported`&#xd;\n   ,MAX(IF(obs.concept_id= 164983, obs.value_text, NULL)) as  `CheckedBy`&#xd;\n   ,MAX(IF(obs.concept_id= 164984,  obs.value_datetime, NULL)) as `DateChecked`&#xd;\n   &#xd;\n  FROM  encounter &#xd;\n  left join patient on(encounter.patient_id=patient.patient_id and patient.voided=0 and encounter.voided=0)&#xd;\n  left join  obs on(obs.encounter_id=encounter.encounter_id)&#xd;\n  left join patient_identifier pid1 on(pid1.patient_id=encounter.patient_id and pid1.identifier_type=4)&#xd;\n  left join patient_identifier pid2 on(pid2.patient_id=encounter.patient_id and pid2.identifier_type=3)&#xd;\n  left join form on(encounter.form_id=form.form_id and encounter.voided=0)&#xd;\n  left join users on(encounter.creator=users.user_id)&#xd;\n  left join person_name prs1 on(prs1.person_id=users.person_id and prs1.voided=0)&#xd;\n  left join concept_name cn1 on(cn1.concept_id=obs.value_coded and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\n where encounter.form_id=21  and encounter.voided=0&#xd;\nAND encounter.form_id=21 AND encounter.encounter_datetime BETWEEN :startDate and :endDate GROUP BY patient.patient_id,encounter.encounter_id,encounter.encounter_datetime;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-04-13 12:08:02', 1, '2019-07-01 12:34:47', 1, 0, NULL, NULL, NULL, '1ecb3d1e-0572-4da9-b98f-aa1b47ed7c5e'),
