(21, 'Patient Line Listing', 'Patient Line Listing', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"71f874fe-f95a-42f5-bb8a-ac1fa20b1b3d\" retired=\"false\">\n  <name>Patient Line Listing</name>\n  <description>Patient Line Listing</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-07-03 08:03:38 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2018-08-24 10:59:30 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>21</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Male,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\npatient_program.date_enrolled AS EnrollDate&#xd;\n,MAX(IF(sinner.concept_id=159599, obs.obs_datetime, NULL)) AS  `ARTStartDate`&#xd;\n/* ,MAX(IF(sinner.concept_id=7778430, obs.value_text, NULL)) as  `PhoneNo`*/&#xd;\n,MAX(IF(sinner.concept_id=165050, cn1.name, NULL)) AS  `LastPMTCTLink`&#xd;\n,MAX(IF(sinner.concept_id=165050, sinner.last_date, NULL)) AS  `LastPMTCTLinkDate`&#xd;\n,MAX(IF(sinner.concept_id=856,obs.value_numeric, NULL)) AS  `LastViralLoad`&#xd;\n,MAX(IF(sinner.concept_id=856,sinner.last_date, NULL)) AS  `LastViralLoadDate`&#xd;\n,MAX(IF(sinner.concept_id=165708, cn1.name, NULL)) AS  ` LastRegimenLine`&#xd;\n,MAX(IF(sinner.concept_id=165708, sinner.last_date, NULL)) AS  ` LastRegimenLineDate`&#xd;\n,MAX(IF(sinner.concept_id=164506,cn1.name, IF(sinner.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id=164506,sinner.last_date, IF(sinner.concept_id=164507,sinner.last_date, NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id=164513,cn1.name, IF(sinner.concept_id=164514,cn1.name, NULL)))  AS  `LastSecondLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id=164513,sinner.last_date, IF(sinner.concept_id=164514,sinner.last_date, NULL))) AS  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id=164702,cn1.name, IF(sinner.concept_id=165703,cn1.name, NULL)))  AS  `LastThirdLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id=164702,sinner.last_date, IF(sinner.concept_id=165703,sinner.last_date, NULL))) AS  `LastThirdLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id= 165470,cn1.name, NULL)) AS  `LastPatientOutcome`&#xd;\n,MAX(IF(sinner.concept_id= 165470,sinner.last_date, NULL)) AS  `LastPatientOutcomeDate`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(YEAR,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(year)`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(MONTH,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(month)`&#xd;\n,MAX(IF(sinner.concept_id=165708, sinner.last_date, NULL)) AS  `Last Pick Up Date`&#xd;\n,MAX(IF(sinner.concept_id=159368,obs.value_numeric, NULL)) AS  `Months of ARV Refill`&#xd;\n,MAX(IF(smin.concept_id=165708,cn2.name, NULL)) AS  `Regimen Line at Start`&#xd;\n,MAX(IF(smin.concept_id IN(164506,164507,164513,164514,165702,165703),cn2.name, NULL)) AS  `Regimen at Start`&#xd;\n,MAX(IF(sinner.concept_id=165050, cn1.name, NULL)) AS  `Pregnancy Status`&#xd;\n,MAX(IF(sinner.concept_id=164980, cn1.name, NULL)) AS  `Viral Load Indication`&#xd;\n,MAX(IF(sinner.concept_id= 165470,cn1.name, IF(sinner.concept_id=165708, IF(TIMESTAMPDIFF(MONTH,sinner.last_date,CURDATE())&gt;5,&quot;INACTIVE&quot;,&quot;ACTIVE&quot;), NULL))) AS  `Patient Status`&#xd;\n/*,MAX(IF(sinner.concept_id=165708, IF(TIMESTAMPDIFF(MONTH,sinner.last_date,CURDATE())&gt;5,&quot;INACTIVE&quot;,&quot;ACTIVE&quot;), NULL)) AS  `Patient Status`*/&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsinner ON (sinner.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=sinner.person_id AND obs.concept_id=sinner.concept_id AND obs.obs_datetime=sinner.last_date AND obs.concept_id IN(159599,165050,856,165708,164506,164507,164513,164514,165702,165703,165470))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(159599,165050,856,165708,164506,164507,164513,164514,165702,165703,165470))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\nWHERE patient.voided=0 &#xd;\nGROUP BY patient.patient_id&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-07-03 09:03:38', 1, '2018-08-24 11:59:30', 1, 0, NULL, NULL, NULL, '71f874fe-f95a-42f5-bb8a-ac1fa20b1b3d'),
(22, 'Viral Load Eligibility', 'Viral Load Eligibility', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"39ab8d69-8b83-4b44-ac70-4fe87fc36f8c\" retired=\"false\">\n  <name>Viral Load Eligibility</name>\n  <description>Viral Load Eligibility</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-23 10:45:46 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-08 22:07:47 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>22</id>\n  <sqlQuery>select&#xd;\npid1.identifier as PepfarID,&#xd;\npid2.identifier as HospID,&#xd;\npn3.given_name as firstName,&#xd;\npn3.family_name as familyName,&#xd;\nperson.gender as Male,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate as DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) as Age,&#xd;\npatient_program.date_enrolled as EnrollDate&#xd;\n,MAX(IF(sinner.concept_id=159599, obs.obs_datetime, NULL)) as  `ARTStartDate`&#xd;\n,MAX(IF(sinner.concept_id=165050, cn1.name, NULL)) &#xd;\n as `LastPMTCTLink`&#xd;\n,MAX(IF(sinner.concept_id=165050, sinner.last_date, NULL)) as  `LastPMTCTLinkDate`&#xd;\n,MAX(IF(sinner.concept_id=856,obs.value_numeric, NULL)) as  `LastViralLoad`&#xd;\n,MAX(IF(sinner.concept_id=856,sinner.last_date, NULL)) as  `LastViralLoadDate`&#xd;\n,MAX(IF(sinner.concept_id= 165708, cn1.name, NULL)) as  `LastRegimenLine`&#xd;\n,MAX(IF(sinner.concept_id= 165708, sinner.last_date, NULL)) as  `LastARTPickupDate`&#xd;\n,MAX(IF(sinner.concept_id=159368, obs.value_numeric, NULL)) AS  `DaysOfARVRefill`&#xd;\n,MAX(IF(sinner.concept_id= 5096, sinner.last_date, NULL)) as  `NextAppointmentDate`&#xd;\n,MAX(IF(sinner.concept_id in (164506,164507),cn1.name, NULL)) as  `LastFirstLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id in (164506,164507), sinner.last_date, NULL)) as  `LastFirstLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id in (164513,164514),cn1.name, NULL)) as  `LastSecondLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id in (164513,164514), sinner.last_date, NULL)) as  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id= 165470,cn1.name, NULL)) as  `LastPatientOutcome`&#xd;\n,MAX(IF(sinner.concept_id=165470,sinner.last_date, NULL)) as  `LastPatientOutcomeDate`&#xd;\nfrom patient&#xd;\nleft join patient_identifier pid1 on(pid1.patient_id=patient.patient_id and pid1.identifier_type=4 and pid1.voided=0)&#xd;\nleft join patient_identifier pid2 on(pid2.patient_id=patient.patient_id and pid2.identifier_type=5 and pid2.voided=0)&#xd;\nleft join person_name pn3 on(patient.patient_id=pn3.person_id and pn3.voided=0)&#xd;\nleft join person on(person.person_id=patient.patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nleft join patient_program on(patient_program.patient_id=person.person_id and patient_program.voided=0)&#xd;\nleft join&#xd;\n(&#xd;\nselect obs.person_id,obs.concept_id, MAX(obs.obs_datetime) as last_date from obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsinner on (sinner.person_id=patient.patient_id)&#xd;\ninner join obs on(obs.person_id=sinner.person_id and obs.concept_id=sinner.concept_id and obs.obs_datetime=sinner.last_date and obs.concept_id in(5096,159599,159635,165050,856,165708,164506,164507,164513,164514,165470,159368))&#xd;\nleft join concept_name cn1 on(obs.value_coded=cn1.concept_id and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\nwhere patient.voided=0 and obs.voided=0&#xd;\nGROUP BY patient.patient_id</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-08-23 11:45:46', 1, '2019-07-08 23:07:47', 1, 0, NULL, NULL, NULL, '39ab8d69-8b83-4b44-ac70-4fe87fc36f8c'),
