(24, 'Viral Load Eligibility', 'Viral Load Eligibility', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"11a881df-ffd2-44c8-a1e6-7d6706198513\" retired=\"false\">\n  <name>Viral Load Eligibility</name>\n  <description>Viral Load Eligibility</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-23 13:04:20 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2018-08-23 13:04:44 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>24</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>Viral_Load_Eligibility</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" uuid=\"39ab8d69-8b83-4b44-ac70-4fe87fc36f8c\"/>\n        <parameterMappings id=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-08-23 14:04:20', 1, '2018-08-23 14:04:44', 1, 0, NULL, NULL, NULL, '11a881df-ffd2-44c8-a1e6-7d6706198513'),
(25, 'Lost to FollowUp', 'Lost to FollowUp', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"6ed26610-69fb-41f0-a04b-e85c50e88f9c\" retired=\"false\">\n  <name>Lost to FollowUp</name>\n  <description>Lost to FollowUp</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-23 13:27:27 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2018-08-23 13:31:22 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>25</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PEPFAR_ID,&#xd;\npid2.identifier AS HOSP_ID,&#xd;\nperson_name.given_name AS FirstName,&#xd;\nperson_name.family_name AS LastName,&#xd;\nperson_name.middle_name AS MiddleName,&#xd;\nperson.birthdate AS DOB,&#xd;\nperson.gender AS SEX,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS AGE,&#xd;\nperson.creator,&#xd;\nCONCAT(person_address.address1 ,&quot; &quot;,person_address.address2 ,&quot; &quot;,&#xd;\nperson_address.city_village ,&quot; &quot;,person_address.state_province ) AS PTS_ADDRS,&#xd;\nperson.date_created AS ENTRD_DT,&#xd;\npp1.date_enrolled AS ENROLL_DT_CARE,&#xd;\npts_last.lst_vst_dt AS LAST_VISIT_DT&#xd;\nFROM patient&#xd;\nLEFT JOIN person ON(patient.patient_id=person.person_id AND person.voided=0)&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.identifier_type=4 AND pid1.patient_id=patient.patient_id AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.identifier_type=5 AND pid2.patient_id=patient.patient_id AND pid2.voided=0)&#xd;\nLEFT JOIN person_name ON(patient.patient_id=person_name.person_id AND person_name.voided=0)&#xd;\nLEFT JOIN person_address ON(patient.patient_id=person_address.person_id AND person_address.voided=0)&#xd;\nLEFT JOIN users ON(patient.creator=users.user_id)&#xd;\nLEFT JOIN patient_program pp1 ON(pp1.patient_id=patient.patient_id AND pp1.program_id=1 AND pp1.voided=0)&#xd;\nLEFT JOIN (SELECT encounter.patient_id,MAX(encounter.encounter_datetime) AS lst_vst_dt FROM encounter GROUP BY encounter.patient_id) &#xd;\nAS  pts_last ON(pts_last.patient_id=patient.patient_id)&#xd;\nWHERE TIMESTAMPDIFF(MONTH,pts_last.lst_vst_dt,CURDATE()) &gt;0 AND pp1.program_id=1 AND patient.voided=0;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-08-23 14:27:27', 1, '2018-08-23 14:31:22', 1, 0, NULL, NULL, NULL, '6ed26610-69fb-41f0-a04b-e85c50e88f9c'),
