(28, 'Patient Ever Enrolled', 'Patient Ever Enrolled', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"4e1951d9-50dc-41d4-83e1-1d4d7b90013e\" retired=\"false\">\n  <name>Patient Ever Enrolled</name>\n  <description>Patient Ever Enrolled</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-24 10:59:58 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-15 09:28:36 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>28</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS `Current Age`&#xd;\n,patient_program.date_enrolled AS EnrollDate&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\n&#xd;\nWHERE patient.voided=0 AND patient_program.program_id=1 AND patient_program.date_enrolled BETWEEN :startDate AND :endDate&#xd;\nGROUP BY patient.patient_id&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-08-24 11:59:58', 1, '2019-07-15 10:28:36', 1, 0, NULL, NULL, NULL, '4e1951d9-50dc-41d4-83e1-1d4d7b90013e'),
(29, 'Patient Ever Enrolled', 'Patient Ever Enrolled', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"767e60b7-5671-4d0d-850e-934a1b48474a\" retired=\"false\">\n  <name>Patient Ever Enrolled</name>\n  <description>Patient Ever Enrolled</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-24 11:01:29 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2018-08-24 11:09:08 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>29</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>Patient-Ever-Enrolled</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"4e1951d9-50dc-41d4-83e1-1d4d7b90013e\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-08-24 12:01:29', 1, '2018-08-24 12:09:08', 1, 0, NULL, NULL, NULL, '767e60b7-5671-4d0d-850e-934a1b48474a'),
(30, 'E-Register', 'E-Register', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"90782af6-8157-41a0-b1e0-3727b3dd6d11\" retired=\"false\">\n  <name>E-Register</name>\n  <description>E-Register</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2018-08-24 11:51:37 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2018-08-24 11:58:58 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>30</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Male,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS `Current Age`&#xd;\n,patient_program.date_enrolled AS EnrollDate&#xd;\n,MAX(IF(sinner.concept_id=159599, obs.obs_datetime, NULL)) AS  `ARTStartDate`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(YEAR,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(year)`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(MONTH,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(month)`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(YEAR,person.birthdate,patient_program.date_enrolled), NULL)) AS  `Age at Enrollment`&#xd;\n,MAX(IF(sinner.concept_id=159599, TIMESTAMPDIFF(MONTH,obs.obs_datetime,CURDATE()), NULL)) AS  `Months on ART`&#xd;\n,TIMESTAMPDIFF(MONTH,patient_program.date_enrolled,CURDATE()) AS `Months in Care`&#xd;\n,MAX(IF(sinner.concept_id=165708, sinner.last_date, NULL)) AS  `Last Pick Up Date`&#xd;\n,pts_last.lst_vst_dt AS  `Last Visit Date`&#xd;\n,MAX(IF(sinner.concept_id=165242, cn1.name, NULL)) AS  `PriorART`&#xd;\n,MAX(IF(sinner.concept_id=5089, obs.value_numeric, NULL)) AS  `Weight(Kg)`&#xd;\n,MAX(IF(sinner.concept_id=5090, obs.value_numeric, NULL)) AS  `Height/Length(cm)`&#xd;\n,MAX(IF(sinner.concept_id=1342, obs.value_numeric, NULL)) AS  `BMI`&#xd;\n,MAX(IF(sinner.concept_id=165935, cn1.name, NULL)) AS  `MUAC`&#xd;\n,MAX(IF(sinner.concept_id=5356, cn1.name, NULL)) AS  `WHO`&#xd;\n,MAX(IF(sinner.concept_id=1659, cn1.name, NULL)) AS  `TB Status`&#xd;\n,MAX(IF(sinner.concept_id=165050, cn1.name, NULL)) AS  `Pregnancy Status`&#xd;\n,MAX(IF(sinner.concept_id=856,obs.value_numeric, NULL)) AS  `LastViralLoad`&#xd;\n,MAX(IF(sinner.concept_id=856,sinner.last_date, NULL)) AS  `LastViralLoadDate`&#xd;\n,MAX(IF(sinner.concept_id=165708, cn1.name, NULL)) AS  ` LastRegimenLine`&#xd;\n,MAX(IF(sinner.concept_id=165708, sinner.last_date, NULL)) AS  ` LastRegimenLineDate`&#xd;\n,MAX(IF(sinner.concept_id=164506,cn1.name, IF(sinner.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n,MAX(IF(sinner.concept_id=164506,sinner.last_date, IF(sinner.concept_id=164507,sinner.last_date, NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n,MAX(IF(sinner.concept_id= 165470,cn1.name, IF(sinner.concept_id=165708, IF(TIMESTAMPDIFF(MONTH,sinner.last_date,CURDATE())&gt;5,&quot;INACTIVE&quot;,&quot;ACTIVE&quot;), NULL))) AS  `Patient Status`&#xd;\n,MAX(IF(smin.concept_id=165727 AND obs2.value_coded=1679,obs2.obs_datetime,NULL)) AS INHStartDate&#xd;\n,MAX(IF(smin.concept_id=165727 AND obs2.value_coded=165257,obs2.obs_datetime,NULL)) AS CTXStartDate&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsinner ON (sinner.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=sinner.person_id AND obs.concept_id=sinner.concept_id AND obs.obs_datetime=sinner.last_date AND obs.concept_id IN(159599,165708,165470))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(159599,165708,165470))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\nLEFT JOIN (SELECT encounter.patient_id,MAX(encounter.encounter_datetime) AS lst_vst_dt FROM encounter GROUP BY encounter.patient_id) &#xd;\nAS  pts_last ON(pts_last.patient_id=patient.patient_id)&#xd;\nWHERE patient.voided=0 AND patient_program.program_id=1 AND patient_program.date_enrolled BETWEEN :startDate AND :endDate&#xd;\nGROUP BY patient.patient_id,IF(sinner.concept_id=159599, TIMESTAMPDIFF(MONTH,obs.obs_datetime,CURDATE()), NULL);&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2018-08-24 12:51:37', 1, '2018-08-24 12:58:58', 1, 0, NULL, NULL, NULL, '90782af6-8157-41a0-b1e0-3727b3dd6d11'),
