  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2018-08-24 12:52:03', 1, '2018-08-24 12:56:44', 1, 0, NULL, NULL, NULL, '8d011f8c-5232-4f57-bf10-217c54ea8bdf'),
(32, 'Clinical-CareCardFollowUp', 'Dataset from the inside of the Care Card', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"9872d016-30c5-48f4-8115-5590e2a9dc8d\" retired=\"false\">\n  <name>Clinical-CareCardFollowUp</name>\n  <description>Dataset from the inside of the Care Card</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-01 11:38:12 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-01 11:38:19 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>32</id>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-07-01 12:38:12', 1, '2019-07-01 12:38:19', 1, 0, NULL, NULL, NULL, '9872d016-30c5-48f4-8115-5590e2a9dc8d'),
(33, 'Pharmacy-DrugReport', 'Export of all dispensed drugs', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"dcdd2d6a-4c53-4ba4-a60d-ed16c53ecc53\" retired=\"false\">\n  <name>Pharmacy-DrugReport</name>\n  <description>Export of all dispensed drugs</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-01 11:42:50 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-15 09:24:39 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>33</id>\n  <sqlQuery>select &#xd;\nobs.person_id as patientID,&#xd;\nencounter.encounter_id,&#xd;\npid1.identifier as pepfarID,&#xd;\npid2.identifier as hospID,&#xd;\nperson.gender as Sex,&#xd;\nperson.birthdate as DoB,&#xd;\nTIMESTAMPDIFF(YEAR, person.birthdate,curdate()) as Age,&#xd;\nDATE_FORMAT(encounter.encounter_datetime,&apos;%d-%b-%Y&apos;) as DispenseDate,&#xd;\nform.name as PMMForm,&#xd;\nCONCAT(pn2.given_name,&apos;&apos;,pn2.family_name) as DispensedBy,&#xd;\nCONCAT(pn1.given_name,&apos;&apos;,pn1.family_name) as enteredBy,&#xd;\nencounter.date_created as dateEntered&#xd;\n,MAX(IF(obs.concept_id IN (165724,165727,165304),cn1.name, NULL)) as  `DrugName`&#xd;\n,MAX(IF(obs.concept_id=165723,cn1.name, NULL)) as  `DrugStrength`&#xd;\n,MAX(IF(obs.concept_id=165723,cn1.name, NULL)) as  `DrugFrequency`&#xd;\n,MAX(IF(obs.concept_id=159368,obs.value_numeric, NULL)) as  `DrugDurationDays`&#xd;\n,MAX(IF(obs.concept_id=159368,obs.value_numeric, NULL)) as  `DrugQuantityPrescribedValue`&#xd;\n,MAX(IF(obs.concept_id=1443,obs.value_numeric, NULL)) as  `DrugQuantityDispensedValue`&#xd;\nfrom obs &#xd;\nleft join person on(person.person_id=obs.person_id and person.voided=0)&#xd;\nleft join patient_identifier pid1 on(pid1.patient_id=obs.person_id and pid1.identifier_type=4 and pid1.voided=0)&#xd;\nleft join patient_identifier pid2 on(pid2.patient_id=obs.person_id and pid2.identifier_type=5 and pid2.voided=0)&#xd;\nleft join encounter on(encounter.encounter_id=obs.encounter_id and encounter.voided=0)&#xd;\nleft join encounter_provider on(encounter_provider.encounter_id=encounter.encounter_id)&#xd;\nleft join users usr1 on(usr1.user_id=encounter.creator and encounter.voided=0)&#xd;\nleft join person_name pn1 on(usr1.person_id=pn1.person_id and pn1.voided=0)&#xd;\nleft join person_name pn2 on(encounter_provider.provider_id=pn2.person_id and pn2.voided=0)&#xd;\nleft join form on(form.form_id=encounter.form_id and encounter.voided=0)&#xd;\nleft join concept_name cn1 on(obs.value_coded=cn1.concept_id and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\nwhere encounter.form_id=27  and obs_group_id is not null and encounter.encounter_datetime BETWEEN :startDate and :endDate&#xd;\nGROUP BY obs.person_id,encounter.encounter_id,obs.obs_group_id &#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-07-01 12:42:50', 1, '2019-07-15 10:24:39', 1, 0, NULL, NULL, NULL, 'dcdd2d6a-4c53-4ba4-a60d-ed16c53ecc53'),
(34, 'LAB-ViralLoads', 'Viral load result data entered into the system', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"1253836d-1920-4a67-84b1-9cabe146c33f\" retired=\"false\">\n  <name>LAB-ViralLoads</name>\n  <description>Viral load result data entered into the system</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-01 12:04:25 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-15 10:09:47 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>34</id>\n  <sqlQuery>select&#xd;\nobs.person_id as PatientID,&#xd;\npid1.identifier as PepfarID,&#xd;\npid2.identifier as HospID,&#xd;\nperson.gender as Sex,&#xd;\nperson.birthdate as DoB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,curdate()) as Age,&#xd;\nDATE_FORMAT(encounter.encounter_datetime,&apos;%d-%b-%Y&apos;) as SampleCollectionDate,&#xd;\nform.name as PMMForm,&#xd;\nCONCAT(pn2.given_name,&apos;&apos;,pn2.family_name) as Provider,&#xd;\nMAX(IF(obs.concept_id=856,obs.value_numeric, NULL)) AS ViralLoad,&#xd;\nMAX(IF(obs.concept_id=164989,obs.value_text, NULL)) AS OrderedBy,&#xd;\nMAX(IF(obs.concept_id=164983,obs.value_text, NULL)) AS CheckedBy,&#xd;\nMAX(IF(obs.concept_id=164982,obs.value_text, NULL)) AS ReportedBy,&#xd;\nMAX(IF(obs.concept_id=164989,obs.value_datetime, NULL)) AS OrderedDate,&#xd;\nMAX(IF(obs.concept_id=164983,obs.value_datetime, NULL)) AS CheckedDate,&#xd;\nMAX(IF(obs.concept_id=165414,obs.value_datetime, NULL)) AS ReportedDate&#xd;\nFROM&#xd;\nobs&#xd;\ninner join patient on(patient.patient_id=obs.person_id and patient.voided=0)&#xd;\nleft join patient_identifier pid1 on(pid1.patient_id=obs.person_id and pid1.identifier_type=4 and pid1.voided=0)&#xd;\nleft join patient_identifier pid2 on(pid2.patient_id=obs.person_id and pid2.identifier_type=5 and pid2.voided=0)&#xd;\nleft join encounter on(encounter.encounter_id=obs.encounter_id and encounter.voided=0)&#xd;\nleft join encounter_provider on(encounter_provider.encounter_id=encounter.encounter_id and encounter.voided=0)&#xd;\nleft join users usr1 on(usr1.user_id=encounter.creator and encounter.voided=0)&#xd;\nleft join person_name pn1 on(usr1.person_id=pn1.person_id and pn1.voided=0)&#xd;\nleft join form on(form.form_id=encounter.form_id and encounter.voided=0)&#xd;\nleft join concept_name cn1 on(obs.value_coded=cn1.concept_id and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\nleft join person_name pn2 on(pn2.person_id=encounter_provider.provider_id)&#xd;\nleft join person on(person.person_id=obs.person_id and person.voided=0)&#xd;\nwhere encounter.form_id =21&#xd;\n and&#xd;\nobs.concept_id in (856,164989,164983,165414)&#xd;\nGROUP BY encounter.patient_id,obs.encounter_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-07-01 13:04:25', 1, '2019-07-15 11:09:47', 1, 0, NULL, NULL, NULL, '1253836d-1920-4a67-84b1-9cabe146c33f'),
(35, 'SI-RADET', 'Export of the RADET dataset', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"6462dd79-d0bf-4686-97d1-fa29ad2ae03d\" retired=\"false\">\n  <name>SI-RADET</name>\n  <description>Export of the RADET dataset</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-08 23:21:26 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-05 14:56:35 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>35</id>\n  <sqlQuery>select &#xd;\n  pid1.identifier as `Patient Unique ID/ART No`,&#xd;\n  pid2.identifier as  `Patient Hospital No`,&#xd;\n  person.gender as `Sex`,&#xd;\n  MAX(IF(obs.concept_id=159599,IF(TIMESTAMPDIFF(YEAR,person.birthdate,obs.value_datetime)&gt;=5,@ageAtStart:=TIMESTAMPDIFF(YEAR,person.birthdate,obs.value_datetime),@ageAtStart:=0),null)) as&#xd;\n  `Age at Start of ART(Years)`,&#xd;\n  MAX(IF(obs.concept_id=159599,IF(TIMESTAMPDIFF(YEAR,person.birthdate,obs.value_datetime)&lt;5,TIMESTAMPDIFF(MONTH,person.birthdate,obs.value_datetime),null),null) ) as `Age at Start of ART(Months)`,&#xd;\n  MAX(IF(obs.concept_id=159599,DATE_FORMAT(obs.value_datetime,&apos;%d-%b-%Y&apos;),null)) as `ART Start Date`,&#xd;\n MAX(IF(obs.concept_id=165708,DATE_FORMAT(sinner.last_date,&apos;%d-%b-%Y&apos;),null)) as `Last Pickup Date`,&#xd;\n MAX(IF(obs.concept_id=159368,@daysOfRefil:=obs.value_numeric,null)) as `DaysOfARVRefil`,&#xd;\n MAX(IF(obs2.concept_id=165708,cn2.name,null)) as `Regimen Line at ART Start`,&#xd;\nMAX(&#xd;\n   IF(obs2.concept_id=164506,cn2.`name`,&#xd;\n   IF(obs2.concept_id=164513,cn2.`name`,&#xd;\n   IF(obs2.concept_id=164507,cn2.name,&#xd;\n   IF(obs2.concept_id=164514,cn2.name,&#xd;\n   IF(obs2.concept_id=165702,cn2.name,&#xd;\n   IF(obs2.concept_id=165703,cn2.name,null&#xd;\n   ))))))) as `Regimen at ART Start`,&#xd;\nMAX(IF(obs.concept_id=165708,cn1.name,null) ) as `Current Regimen Line`,&#xd;\nMAX(IF(obs.concept_id in(&#xd;\n164506,164513,165702,164507,164514,165703) ,cn1.`name`,null)) as `Current ART Regimen`,&#xd;\nMAX(IF(obs.concept_id=165050,cn1.name,null)) as `Pregnancy Status`,&#xd;\nMAX(IF(obs.concept_id=856,obs.value_numeric,null)) as `Current Viral Load (c/ml)`,&#xd;\nMAX(IF(obs.concept_id=856,DATE_FORMAT(obs.obs_datetime,&apos;%d-%b-%Y&apos;),null)) as `Date of Current Viral Load (dd/mm/yy)`,&#xd;\nMAX(IF(obs.concept_id=164980,cn1.name,null) ) as `Viral Load Indication`,&#xd;\nMAX(IF(obs.concept_id=165470,cn1.name,IF(obs.concept_id=165708,IF(TIMESTAMPDIFF(DAY,sinner.last_date,:endDate)&lt; @daysOfRefil + 28,&quot;Active&quot;,&quot;LTFU&quot;),null))) as `Current ART Status`,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,curdate())&gt;=5,TIMESTAMPDIFF(YEAR,person.birthdate,curdate()),null) as `CurrentAge(Years)`,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,curdate())&lt;5,TIMESTAMPDIFF(MONTH,person.birthdate,curdate()),null) as `CurrentAge(Months)`,&#xd;\nDATE_FORMAT(person.birthdate,&apos;%d-%b-%Y&apos;) as `DateOfBirth`&#xd;\n  from patient&#xd;\n  LEFT JOIN patient_identifier pid1 on(pid1.patient_id=patient.patient_id and patient.voided=0 and pid1.identifier_type=4)&#xd;\n  LEFT JOIN patient_identifier pid2 on(pid2.patient_id=patient.patient_id and patient.voided=0 and pid2.identifier_type=5)&#xd;\n  INNER JOIN&#xd;\n  (select &#xd;\nobs.person_id,&#xd;\nobs.concept_id,&#xd;\n MAX(obs.obs_datetime) as last_date, &#xd;\nMIN(obs.obs_datetime) as first_date&#xd;\nfrom obs where obs.voided=0 and obs.obs_datetime&lt;=:endDate and concept_id in(159599,165708,159368,164506,164513,164507,164514,165702,165703,165050,&#xd;\n856,164980,165470) GROUP BY obs.person_id,obs.concept_id ) as sinner&#xd;\non (sinner.person_id=patient.patient_id )&#xd;\nINNER JOIN obs on(obs.person_id=patient.patient_id and obs.concept_id=sinner.concept_id and obs.obs_datetime=sinner.last_date and obs.voided=0 )&#xd;\nINNER JOIN obs obs2 on(obs2.person_id=patient.patient_id and obs2.concept_id=sinner.concept_id and obs2.obs_datetime=sinner.first_date and obs2.voided=0 )&#xd;\nINNER JOIN encounter on(encounter.patient_id=patient.patient_id and encounter.form_id=23 and encounter.voided=0)&#xd;\nINNER JOIN person on(person.person_id=patient.patient_id)&#xd;\nleft join concept_name cn1 on(obs.value_coded=cn1.concept_id and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\nleft join concept_name cn2 on(obs2.value_coded=cn2.concept_id and cn2.locale=&apos;en&apos; and cn2.locale_preferred=1)&#xd;\nWHERE patient.voided=0 and obs.concept_id in(159599,165708,159368,164506,164513,164507,164514,165702,165703,165050,856,164980,165470) and obs2.concept_id in(159599,165708,159368,164506,164513,164507,164514,165702,165703,165050,856,164980,165470) GROUP BY patient.patient_id,pid1.identifier,pid2.identifier ;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-07-09 00:21:26', 1, '2019-09-05 15:56:35', 1, 0, NULL, NULL, NULL, '6462dd79-d0bf-4686-97d1-fa29ad2ae03d'),
(36, 'SI - RADET', 'An export of the RADET dataset', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"45af899b-f6d2-4a46-b89a-e6b5696dd7de\" retired=\"false\">\n  <name>SI - RADET</name>\n  <description>An export of the RADET dataset</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-08 23:55:05 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-08 23:55:54 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>36</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>SI-RADET</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"6462dd79-d0bf-4686-97d1-fa29ad2ae03d\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-07-09 00:55:05', 1, '2019-07-09 00:55:54', 1, 0, NULL, NULL, NULL, '45af899b-f6d2-4a46-b89a-e6b5696dd7de'),
(37, 'HI-FingerprintStatistics', 'Number of patients with Biometric Data Capture', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"d09bbc5d-46b3-45fe-8ae1-50ad51ae8aad\" retired=\"false\">\n  <name>HI-FingerprintStatistics</name>\n  <description>Number of patients with Biometric Data Capture</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-21 00:31:33 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-21 00:33:31 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>37</id>\n  <sqlQuery>SELECT COUNT(DISTINCT patient_Id) as NumberOfPatients, DATE(date_created) as CaptureDate FROM openmrs.biometricinfo &#xd;\nGROUP BY DATE(date_created) ;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-07-21 01:31:33', 1, '2019-07-21 01:33:31', 1, 0, NULL, NULL, NULL, 'd09bbc5d-46b3-45fe-8ae1-50ad51ae8aad'),
(38, 'HI - Fingerprint Statistics', 'Number of patients with finger print capture', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"6001512e-8cd3-4f5c-9c86-02f9989effb1\" retired=\"false\">\n  <name>HI - Fingerprint Statistics</name>\n  <description>Number of patients with finger print capture</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-07-21 00:34:48 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-21 00:35:29 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>38</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>HI-FingerprintStatistics</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" uuid=\"d09bbc5d-46b3-45fe-8ae1-50ad51ae8aad\"/>\n        <parameterMappings id=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-07-21 01:34:48', 1, '2019-07-21 01:35:29', 1, 0, NULL, NULL, NULL, '6001512e-8cd3-4f5c-9c86-02f9989effb1'),
(39, 'PVLS Report', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"9b474960-dbc8-48fe-a195-849080e4c480\" retired=\"false\">\n  <name>PVLS Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-08-29 15:10:36 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-06 16:18:22 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>39</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID, &#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS firstName,&#xd;\npn3.family_name AS familyName,&#xd;\nperson.gender AS Male,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\nMAX(IF(obs.concept_id=856,obs.value_numeric, NULL)) AS ViralLoad,&#xd;\nMAX(IF(obs.concept_id=856,opsson.last_date, NULL)) AS ViralLoadDate,&#xd;\nMAX(IF(obs.concept_id=159599,obs.value_datetime, NULL)) AS ARTStartDate&#xd;\n&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient.patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient.patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient.patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient.patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id,obs.concept_id,MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nopsson ON (opsson.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=opsson.person_id AND obs.concept_id=opsson.concept_id AND obs.obs_datetime=opsson.last_date AND obs.concept_id IN(159599,856)) &#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1) &#xd;\nWHERE patient.voided=0 AND obs.voided=0 AND obs.value_numeric &lt; 1000 AND TIMESTAMPDIFF(MONTH,opsson.last_date,CURDATE())&gt;=12 AND opsson.last_date between :startDate and :endDate&#xd;\nGROUP BY pid1.identifier, pid2.identifier,pn3.given_name,pn3.family_name,psn_atr.value,person.birthdate,person.gender&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-08-29 16:10:36', 1, '2019-09-06 17:18:22', 1, 0, NULL, NULL, NULL, '9b474960-dbc8-48fe-a195-849080e4c480'),
(40, 'Viral Load Result', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"b001e901-6b95-406f-a816-87cd7e30cad6\" retired=\"false\">\n  <name>Viral Load Result</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-08-30 10:16:45 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-08-30 11:28:43 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>40</id>\n  <sqlQuery>select&#xd;\npid3.identifier as ClientCode,&#xd;\npid1.identifier AS PepfarID,&#xd;\n-- pid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\npatient_program.date_enrolled AS EnrollDate&#xd;\n,MAX(IF(target.concept_id=165843, cn1.name, NULL)) AS  `FinalResult`&#xd;\n-- ,MAX(IF(sinner.concept_id=165843, IF(obs.value_coded=703,&apos;POSITIVE&apos;,&apos;NEGATIVE&apos;), NULL)) AS  `FinalResult`&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4  AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN patient_identifier pid3 ON(pid3.patient_id=patient .patient_id AND pid3.identifier_type=8 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(165843))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(165843))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\nWHERE patient.voided=0 &#xd;\nGROUP BY patient.patient_id</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-08-30 11:16:45', 1, '2019-08-30 12:28:43', 1, 0, NULL, NULL, NULL, 'b001e901-6b95-406f-a816-87cd7e30cad6'),
(42, 'PVLS Report', 'Patient with viral load less than 1000copies', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d43b478c-3c7c-4e4d-8fb5-2e7fa9c290eb\" retired=\"false\">\n  <name>PVLS Report</name>\n  <description>Patient with viral load less than 1000copies</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 09:07:43 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-02 09:11:46 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>42</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>PVLS-Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"9b474960-dbc8-48fe-a195-849080e4c480\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-09-02 10:07:43', 1, '2019-09-02 10:11:46', 1, 0, NULL, NULL, NULL, 'd43b478c-3c7c-4e4d-8fb5-2e7fa9c290eb'),
(43, 'Tx_CURR', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"7a2700a2-4219-45e4-94f4-57a9cc3ca998\" retired=\"false\">\n  <name>Tx_CURR</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 14:18:17 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-06 15:37:09 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>43</id>\n  <sqlQuery>SELECT&#xd;\npatient.patient_id,&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE())&gt;=5,TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()),NULL) AS `CurrentAge(Years)`,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE())&lt;5,TIMESTAMPDIFF(MONTH,person.birthdate,CURDATE()),NULL) AS `CurrentAge(Months)`&#xd;\n,MAX(IF(target.concept_id=164989, target.last_date, NULL)) AS  `DrugPickUpDate`&#xd;\n,MAX(IF(target.concept_id=165050, cn1.name, NULL)) AS  `PregnancyStatus`&#xd;\n ,MAX(IF(target.concept_id=165720, cn1.name, NULL)) AS  `TreatmentAgeCategory`&#xd;\n ,MAX(IF(target.concept_id=165945 , cn1.name, NULL)) AS  `TreatmentType`&#xd;\n ,MAX(IF(target.concept_id=164181 , cn1.name, NULL)) AS  `VisitType`&#xd;\n ,MAX(IF(target.concept_id=159599, obs.obs_datetime, NULL)) AS  `ARTStartDate`&#xd;\n ,MAX(IF(target.concept_id=159599, TIMESTAMPDIFF(YEAR,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(year)`&#xd;\n ,MAX(IF(target.concept_id=165774 , cn1.name, NULL)) AS  `PickUpReason`&#xd;\n ,MAX(IF(target.concept_id=165708, cn1.name, NULL)) AS  `LastRegimenLine`&#xd;\n ,MAX(IF(target.concept_id=165708, target.last_date, NULL)) AS  ` LastRegimenLineDate`&#xd;\n ,MAX(IF(target.concept_id=164506,cn1.name, IF(target.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n  ,MAX(IF(target.concept_id=164506,target.last_date, IF(target.concept_id=164507,target.last_date, NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n  ,MAX(IF(target.concept_id=164513,cn1.name, IF(target.concept_id=164514,cn1.name, NULL)))  AS  `LastSecondLineRegimen`&#xd;\n  ,MAX(IF(target.concept_id=164513,target.last_date, IF(target.concept_id=164514,target.last_date, NULL))) AS  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=165702,cn1.name, IF(target.concept_id=165703,cn1.name, NULL)))  AS  `LastThirdLineRegimen`&#xd;\n,MAX(IF(target.concept_id=165702,target.last_date, IF(target.concept_id=165703,target.last_date, NULL))) AS  `LastThirdLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=159368, target.DrugRef, NULL)) AS  `Drug Refil`&#xd;\n&#xd;\n,MAX(IF(target.concept_id= 165470,cn1.name, IF(target.concept_id=165708, IF(target.last_date+ target.DrugRef+28 &lt; CURDATE(),&quot;INACTIVE&quot;,&quot;ACTIVE&quot;), NULL))) AS  `Patient Status 28Days` &#xd;\n,MAX(IF(target.concept_id= 165470,cn1.name, IF(target.concept_id=165708, IF(target.last_date+ target.DrugRef+90 &lt; CURDATE(),&quot;INACTIVE&quot;,&quot;ACTIVE&quot;), NULL))) AS  `Patient Status 90Days`&#xd;\nFROM patient &#xd;\n&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4  AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\n&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date, MAX(obs.value_numeric) DrugRef FROM obs GROUP BY obs.person_id, obs.concept_id,obs.value_numeric)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(164989,165050,165720,165945,164181,165774,165708,164506,164507,164513,164514,165702,165703,165470,159368,159599))&#xd;\n&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(164989,165050,165720,165945,164181,165774,165708,164506,164507,164513,164514,164702,1645703,165470,159368,159599))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\n&#xd;\nWHERE patient.voided=0 AND target.last_date BETWEEN :startDate AND :endDate &#xd;\nGROUP BY patient.patient_id, pid1.identifier, pid2.identifier,pn3.given_name,person.gender,psn_atr.value,person.birthdate,pn3.family_name&#xd;\n</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-09-02 15:18:17', 1, '2019-09-06 16:37:09', 1, 0, NULL, NULL, NULL, '7a2700a2-4219-45e4-94f4-57a9cc3ca998'),
(45, 'HTS_TST', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"b68e950f-e54d-49dc-b8a5-04cad04bf89a\" retired=\"false\">\n  <name>HTS_TST</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 14:23:07 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-02 14:23:19 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>45</id>\n  <sqlQuery>select&#xd;\npid3.identifier as ClientCode,&#xd;\npid1.identifier AS PepfarID,&#xd;\n-- pid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\npatient_program.date_enrolled AS EnrollDate&#xd;\n,MAX(IF(target.concept_id=165843, cn1.name, NULL)) AS  `FinalResult`&#xd;\n-- ,MAX(IF(sinner.concept_id=165843, IF(obs.value_coded=703,&apos;POSITIVE&apos;,&apos;NEGATIVE&apos;), NULL)) AS  `FinalResult`&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4  AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN patient_identifier pid3 ON(pid3.patient_id=patient .patient_id AND pid3.identifier_type=8 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(165843))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(165843))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\nWHERE patient.voided=0 &#xd;\nGROUP BY patient.patient_id</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-09-02 15:23:07', 1, '2019-09-02 15:23:19', 1, 0, NULL, NULL, NULL, 'b68e950f-e54d-49dc-b8a5-04cad04bf89a'),
(46, 'HTS_TST', '', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d8a1ce95-477d-481c-9893-7fa7d1c3b35b\" retired=\"false\">\n  <name>HTS_TST</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 14:23:33 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-02 14:23:50 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>46</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>HTS_TST</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"b68e950f-e54d-49dc-b8a5-04cad04bf89a\"/>\n        <parameterMappings id=\"11\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-09-02 15:23:33', 1, '2019-09-02 15:23:50', 1, 0, NULL, NULL, NULL, 'd8a1ce95-477d-481c-9893-7fa7d1c3b35b'),
(47, 'Tx_NEW', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"ec139e62-7be9-4fab-8222-86914985f491\" retired=\"false\">\n  <name>Tx_NEW</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 14:25:42 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-06 15:32:44 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>47</id>\n  <sqlQuery>SELECT&#xd;\npatient.patient_id,&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE())&gt;=5,TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()),NULL) AS `CurrentAge(Years)`,&#xd;\nIF(TIMESTAMPDIFF(YEAR,person.birthdate,CURDATE())&lt;5,TIMESTAMPDIFF(MONTH,person.birthdate,CURDATE()),NULL) AS `CurrentAge(Months)`&#xd;\n,MAX(IF(target.concept_id=164989, target.last_date, NULL)) AS  `DrugPickUpDate`   /* Why ordered date for drug pickup */&#xd;\n,MAX(IF(target.concept_id=165050, cn1.name, NULL)) AS  `PregnancyStatus`&#xd;\n ,MAX(IF(target.concept_id=165720, cn1.name, NULL)) AS  `TreatmentAgeCategory`&#xd;\n ,MAX(IF(target.concept_id=165945 , cn1.name, NULL)) AS  `TreatmentType`&#xd;\n ,MAX(IF(target.concept_id=164181 , cn1.name, NULL)) AS  `VisitType`&#xd;\n  ,MAX(IF(target.concept_id=159599, obs.obs_datetime, NULL)) AS  `ARTStartDate`&#xd;\n ,MAX(IF(target.concept_id=159599, TIMESTAMPDIFF(YEAR,person.birthdate,obs.obs_datetime), NULL)) AS  `Age at Start of ART(year)`&#xd;\n ,MAX(IF(target.concept_id=165774 , cn1.name, NULL)) AS  `PickUpReason`&#xd;\n ,MAX(IF(target.concept_id=165708, cn1.name, NULL)) AS  `LastRegimenLine`&#xd;\n ,MAX(IF(target.concept_id=165708, target.last_date, NULL)) AS  ` LastRegimenLineDate`&#xd;\n ,MAX(IF(target.concept_id=164506,cn1.name, IF(target.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n  ,MAX(IF(target.concept_id=164506,target.last_date, IF(target.concept_id=164507,target.last_date, NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n  ,MAX(IF(target.concept_id=164513,cn1.name, IF(target.concept_id=164514,cn1.name, NULL)))  AS  `LastSecondLineRegimen`&#xd;\n  ,MAX(IF(target.concept_id=164513,target.last_date, IF(target.concept_id=164514,target.last_date, NULL))) AS  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=165702,cn1.name, IF(target.concept_id=165703,cn1.name, NULL)))  AS  `LastThirdLineRegimen`&#xd;\n,MAX(IF(target.concept_id=165702,target.last_date, IF(target.concept_id=165703,target.last_date, NULL))) AS  `LastThirdLineRegimenDate`&#xd;\nFROM patient &#xd;\n&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4  AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\n&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs WHERE obs.value_coded NOT IN (165662,165772,165665) GROUP BY obs.person_id, obs.concept_id)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(164989,165050,165720,165945,164181,165774,165708,164506,164507,164513,164514,165702,165703,165470,159368,159599) AND obs.value_coded NOT IN (165662,165772,165665))&#xd;\n&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MIN(obs.obs_datetime) AS first_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\nsmin ON (smin.person_id=patient.patient_id)&#xd;\nINNER JOIN obs obs2 ON(obs2.person_id=smin.person_id AND obs2.concept_id=smin.concept_id AND obs2.obs_datetime=smin.first_date AND obs2.concept_id IN(164989,165050,165720,165945,164181,165774,165708,164506,164507,164513,164514,164702,1645703,165470,159368,159599) AND obs.value_coded NOT IN (165662,165772,165665))&#xd;\nLEFT JOIN concept_name cn2 ON(obs2.value_coded=cn2.concept_id AND cn2.locale=&apos;en&apos; AND cn2.locale_preferred=1)&#xd;\n&#xd;\nWHERE patient.voided=0 &#xd;\nGROUP BY patient.patient_id, pid1.identifier, pid2.identifier,pn3.given_name,person.gender,psn_atr.value,person.birthdate,pn3.family_name&#xd;\nHAVING `PickUpReason` IS NOT NULL AND ARTStartDate BETWEEN :startDate AND :endDate</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-09-02 15:25:42', 1, '2019-09-06 16:32:44', 1, 0, NULL, NULL, NULL, 'ec139e62-7be9-4fab-8222-86914985f491'),
(49, 'Viral Load Eligibility 2.0', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"e76833ab-1748-4a03-8f97-2229afb66dc1\" retired=\"false\">\n  <name>Viral Load Eligibility 2.0</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-02 14:28:56 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-02 14:29:12 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>49</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Male,&#xd;\npsn_atr.value AS PhoneNo,&#xd;\nperson.birthdate AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\npatient_program.date_enrolled AS EnrollDate&#xd;\n,MAX(IF(target.concept_id=165050, cn1.name, NULL)) AS  `PregnancyStatus`&#xd;\n,MAX(IF(target.concept_id=159599, obs.obs_datetime, NULL)) AS  `ARTStartDate`&#xd;\n,MAX(IF(target.concept_id=164989, target.last_date, NULL)) AS  `LastDrugPickUpDate`&#xd;\n/* ,MAX(IF(target.concept_id=7778430, obs.value_text, NULL)) as  `PhoneNo`*/&#xd;\n,MAX(IF(target.concept_id=165050, cn1.name, NULL)) AS  `LastPMTCTLink`&#xd;\n,MAX(IF(target.concept_id=165050, target.last_date, NULL)) AS  `LastPMTCTLinkDate`&#xd;\n,MAX(IF(target.concept_id=856,obs.value_numeric, NULL)) AS  `LastViralLoad`&#xd;\n,MAX(IF(target.concept_id=856,target.last_date, NULL)) AS  `LastViralLoadDate`&#xd;\n,MAX(IF(target.concept_id=165470,cn1.name,if(target.concept_id=164989,IF(TIMESTAMPDIFF(MONTH,target.last_date,CURDATE())&lt;6,&quot;NOT ELIGIBLE&quot;,&quot;ELIGIBLE&quot;),NULL) )) AS  `ViralLoad Eligibility`&#xd;\n,MAX(IF(target.concept_id=165708, cn1.name, NULL)) AS  ` LastRegimenLine`&#xd;\n,MAX(IF(target.concept_id=165708, target.last_date, NULL)) AS  ` LastRegimenLineDate`&#xd;\n,MAX(IF(target.concept_id=164506,cn1.name, IF(target.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164506,target.last_date, IF(target.concept_id=164507,target.last_date, NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=164513,cn1.name, IF(target.concept_id=164514,cn1.name, NULL)))  AS  `LastSecondLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164513,target.last_date, IF(target.concept_id=164514,target.last_date, NULL))) AS  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=164702,cn1.name, IF(target.concept_id=165703,cn1.name, NULL)))  AS  `LastThirdLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164702,target.last_date, IF(target.concept_id=165703,target.last_date, NULL))) AS  `LastThirdLineRegimenDate`&#xd;\n-- ,MAX(IF(target.concept_id= 165470,cn1.name, NULL)) AS  `LastPatientOutcome`&#xd;\n-- ,MAX(IF(target.concept_id= 165470,target.last_date, NULL)) AS  `LastPatientOutcomeDate`&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs GROUP BY obs.person_id, obs.concept_id)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(159599,165050,856,165708,164506,164507,164513,164514,165702,165703,165470,164989))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nWHERE patient.voided=0&#xd;\nGROUP BY patient.patient_id</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-09-02 15:28:56', 1, '2019-09-02 15:29:12', 1, 0, NULL, NULL, NULL, 'e76833ab-1748-4a03-8f97-2229afb66dc1'),
