(209, 'Number of people living with HIV and on ART with a viral load test result during the month', 'SQL Cohort Query\r\nDescription: Visit Date: [Last visit date] PLUS ARV Medication > Drugs > Duration (in days) PLUS 90 days ≥ reference date AND Viral Load Test (Date result was received at the facility)', 'org.openmrs.module.reporting.cohort.definition.CohortDefinition', 'org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"ead25902-830f-4b85-aefd-b10cf695ca88\" retired=\"false\">\n  <name>Number of people living with HIV and on ART with a viral load test result during the month</name>\n  <description>SQL Cohort Query&#xd;\nDescription: Visit Date: [Last visit date] PLUS ARV Medication &gt; Drugs &gt; Duration (in days) PLUS 90 days ≥ reference date AND Viral Load Test (Date result was received at the facility)</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-26 19:04:47 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-27 11:01:14 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>209</id>\n  <query>select distinct(pof.patient_id) patientId from&#xd;\n	(SELECT patient_id, encounter_datetime, encounter_id FROM encounter WHERE (encounter_type = 13 AND form_id = 27)&#xd;\n    ORDER BY encounter_datetime desc) pof&#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 159368 AND value_numeric IS NOT NULL) pofOb on pof.patient_id = pofOb.person_id and &#xd;\n    pof.encounter_id = pofOb.encounter_id    &#xd;\n    join&#xd;\n	(SELECT patient_id, encounter_datetime, encounter_id FROM encounter WHERE (encounter_type = 11 AND form_id = 21)) lof &#xd;\n    on pof.patient_id = lof.patient_id &#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 165987 AND value_datetime IS NOT NULL) lofObRd on pof.patient_id = lofObRd.person_id and &#xd;\n    lof.encounter_id = lofObRd.encounter_id&#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 856 AND value_numeric IS NOT NULL) lofObR on pof.patient_id = lofObR.person_id and &#xd;\n    lof.encounter_id = lofObR.encounter_id&#xd;\n&#xd;\nwhere (date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &gt;= date(@startDate) and &#xd;\n	  date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &lt;= date(@endDate))&#xd;\n      and date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &#xd;\n      and date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &gt; date(lofObRd.value_datetime)&#xd;\nGROUP BY pof.patient_id</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>', '2019-09-26 20:04:47', 1, '2019-09-27 12:01:14', 1, 0, NULL, NULL, NULL, 'ead25902-830f-4b85-aefd-b10cf695ca88'),
(210, 'Number of people living with HIV on ART who are virologically suppressed (viral load <1000 c/ml) during the month', 'Visit Date: [Last visit date] PLUS ARV Medication>Drugs>Duration (in days) PLUS 90 days ≥reference date AND Viral Load Test (Date result was received at the facility) within reference period AND Viral Load test result < 1000 copies/ml', 'org.openmrs.module.reporting.cohort.definition.CohortDefinition', 'org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"740810b1-a0f7-4ea9-8b39-0e1c38007919\" retired=\"false\">\n  <name>Number of people living with HIV on ART who are virologically suppressed (viral load &lt;1000 c/ml) during the month</name>\n  <description>Visit Date: [Last visit date] PLUS ARV Medication&gt;Drugs&gt;Duration (in days) PLUS 90 days ≥reference date AND Viral Load Test (Date result was received at the facility) within reference period AND Viral Load test result &lt; 1000 copies/ml</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-26 19:06:20 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-27 11:02:28 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>date</name>\n      <label>Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>210</id>\n  <query>select distinct(pof.patient_id) active_with_vl from&#xd;\n	(SELECT patient_id, encounter_datetime, encounter_id FROM encounter WHERE (encounter_type = 13 AND form_id = 27)&#xd;\n    ORDER BY encounter_datetime desc) pof&#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 159368 AND value_numeric IS NOT NULL) pofOb on pof.patient_id = pofOb.person_id and &#xd;\n    pof.encounter_id = pofOb.encounter_id      &#xd;\n    join&#xd;\n	(SELECT patient_id, encounter_datetime, encounter_id FROM encounter WHERE (encounter_type = 11 AND form_id = 21)) lof &#xd;\n    on pof.patient_id = lof.patient_id     &#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 165987 AND value_datetime IS NOT NULL) lofObRd on pof.patient_id = lofObRd.person_id and &#xd;\n    lof.encounter_id = lofObRd.encounter_id &#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 856 AND value_numeric IS NOT NULL) lofObR on pof.patient_id = lofObR.person_id and &#xd;\n    lof.encounter_id = lofObR.encounter_id &#xd;\n&#xd;\nwhere lofObR.value_numeric &lt; 1000&#xd;\nand &#xd;\n(date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &gt;= date(@startDate) and &#xd;\n	  date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &lt;= date(@endDate))&#xd;\n      and date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &#xd;\n      and date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 90) day)) &gt; date(lofObRd.value_datetime)&#xd;\nGROUP BY pof.patient_id</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>', '2019-09-26 20:06:20', 1, '2019-09-27 12:02:28', 1, 0, NULL, NULL, NULL, '740810b1-a0f7-4ea9-8b39-0e1c38007919'),
(211, 'Total number of people living with HIV who are currently receiving ART during the month (All regimen) (Within 28 days missed appointment)', 'Visit Date: [Last visit date] PLUS ARV Medication>Drugs>Duration (in days) PLUS 28 days => reference date', 'org.openmrs.module.reporting.cohort.definition.CohortDefinition', 'org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition id=\"1\" uuid=\"a2ac640e-1a3d-4703-b5e4-b6466dcb4039\" retired=\"false\">\n  <name>Total number of people living with HIV who are currently receiving ART during the month (All regimen) (Within 28 days missed appointment)</name>\n  <description>Visit Date: [Last visit date] PLUS ARV Medication&gt;Drugs&gt;Duration (in days) PLUS 28 days =&gt; reference date</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-09-26 19:08:42 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-09-27 11:02:48 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>211</id>\n  <query>select distinct(pof.patient_id) AS active_90&#xd;\n  from&#xd;\n	(SELECT patient_id, encounter_datetime, encounter_id FROM encounter WHERE (encounter_type = 13 AND form_id = 27) ORDER BY encounter_datetime desc) pof &#xd;\n    join&#xd;\n    (SELECT * FROM obs WHERE concept_id = 159368 AND value_numeric IS NOT NULL) pofOb on pof.patient_id = pofOb.person_id and &#xd;\n    pof.encounter_id = pofOb.encounter_id         &#xd;\n	where date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 28) day)) &gt;= date(@startDate) and     &#xd;\n     date(DATE_ADD(pof.encounter_datetime, INTERVAL (pofOb.value_numeric + 28) day)) &lt;= date(@endDate)&#xd;\n   GROUP BY pof.patient_id</query>\n</org.openmrs.module.reporting.cohort.definition.SqlCohortDefinition>', '2019-09-26 20:08:42', 1, '2019-09-27 12:02:48', 1, 0, NULL, NULL, NULL, 'a2ac640e-1a3d-4703-b5e4-b6466dcb4039'),
