(217, 'VIRAL-LOAD', 'NMRS VIRAL-LOAD Report', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"55c1e3b9-4b0f-4ddb-ab84-c913998f49b1\" retired=\"false\">\n  <name>VIRAL-LOAD</name>\n  <description>NMRS VIRAL-LOAD Report</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-12-30 18:57:46 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-12-30 18:58:43 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>217</id>\n  <sqlQuery>select&#xd;\nobs.person_id as PatientID,&#xd;\npid1.identifier as PepfarID,&#xd;\npid2.identifier as HospID,&#xd;\nperson.gender as Sex,&#xd;\nperson.birthdate as DoB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,curdate()) as Age,&#xd;\nDATE_FORMAT(encounter.encounter_datetime,&apos;%d-%b-%Y&apos;) as VisitDateSameAsSampleCollectionDate,&#xd;\nform.name as PMMForm,&#xd;\nCONCAT(pn2.given_name,&apos;&apos;,pn2.family_name) as Provider,&#xd;\nMAX(IF(obs.concept_id=856,obs.value_numeric, NULL)) AS ViralLoad,&#xd;\nMAX(IF(obs.concept_id=164989,obs.value_text, NULL)) AS OrderedBy,&#xd;\nMAX(IF(obs.concept_id=164983,obs.value_text, NULL)) AS CheckedBy,&#xd;\nMAX(IF(obs.concept_id=164982,obs.value_text, NULL)) AS ReportedBy,&#xd;\nMAX(IF(obs.concept_id=164989,obs.value_datetime, NULL)) AS OrderedDate,&#xd;\nMAX(IF(obs.concept_id=159951,obs.value_datetime, NULL)) AS SampleCollectionDate,&#xd;\nMAX(IF(obs.concept_id=164984,obs.value_datetime, NULL)) AS CheckedDate,&#xd;\nMAX(IF(obs.concept_id=165414,obs.value_datetime, NULL)) AS ReportedDate&#xd;\nFROM&#xd;\nobs&#xd;\ninner join patient on(patient.patient_id=obs.person_id and patient.voided=0)&#xd;\nleft join patient_identifier pid1 on(pid1.patient_id=obs.person_id and pid1.identifier_type=4 and pid1.voided=0)&#xd;\nleft join patient_identifier pid2 on(pid2.patient_id=obs.person_id and pid2.identifier_type=5 and pid2.voided=0)&#xd;\nleft join encounter on(encounter.encounter_id=obs.encounter_id and encounter.voided=0)&#xd;\nleft join encounter_provider on(encounter_provider.encounter_id=encounter.encounter_id and encounter.voided=0)&#xd;\nleft join users usr1 on(usr1.user_id=encounter.creator and encounter.voided=0)&#xd;\nleft join person_name pn1 on(usr1.person_id=pn1.person_id and pn1.voided=0)&#xd;\nleft join form on(form.form_id=encounter.form_id and encounter.voided=0)&#xd;\nleft join concept_name cn1 on(obs.value_coded=cn1.concept_id and cn1.locale=&apos;en&apos; and cn1.locale_preferred=1)&#xd;\nleft join person_name pn2 on(pn2.person_id=encounter_provider.provider_id)&#xd;\nleft join person on(person.person_id=obs.person_id and person.voided=0)&#xd;\nwhere &#xd;\nencounter.form_id =21&#xd;\n and&#xd;\nencounter.encounter_datetime BETWEEN :startDate and :endDate&#xd;\nand&#xd;\nobs.concept_id in (856,164989,164983,164982,164989,164984,165414,159951)&#xd;\nGROUP BY encounter.patient_id,obs.encounter_id;</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-12-30 19:57:46', 1, '2019-12-30 19:58:43', 1, 0, NULL, NULL, NULL, '55c1e3b9-4b0f-4ddb-ab84-c913998f49b1'),
(218, 'VIRAL LOAD REPORT', 'NMRS Viral load report', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"835014f5-488c-4940-b52e-392a5f607a8b\" retired=\"false\">\n  <name>VIRAL LOAD REPORT</name>\n  <description>NMRS Viral load report</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-12-31 08:07:12 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-12-31 08:13:43 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>218</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>VIRAL-LOAD</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" uuid=\"55c1e3b9-4b0f-4ddb-ab84-c913998f49b1\"/>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-12-31 09:07:12', 1, '2019-12-31 09:13:43', 1, 0, NULL, NULL, NULL, '835014f5-488c-4940-b52e-392a5f607a8b'),
(219, 'ViralLoadEligibility', 'NMRS Viral load eligibility report', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"6e28b86e-dac2-4778-9780-1dc84855e44d\" retired=\"false\">\n  <name>ViralLoadEligibility</name>\n  <description>NMRS Viral load eligibility report</description>\n  <creator id=\"2\" uuid=\"1c3db49d-440a-11e6-a65c-00e04c680037\"/>\n  <dateCreated id=\"3\">2019-12-31 08:16:32 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-12-31 08:16:39 UTC</dateChanged>\n  <parameters id=\"5\"/>\n  <id>219</id>\n  <sqlQuery>SELECT&#xd;\npid1.identifier AS PepfarID,&#xd;\npid2.identifier AS HospID,&#xd;\npn3.given_name AS FirstName,&#xd;\npn3.family_name AS FamilyName,&#xd;\nperson.gender AS Sex,&#xd;\nCONCAT(person_address.address1,&quot; &quot;,person_address.city_village) as PatientAddress,&#xd;\nCOALESCE(CONCAT(&quot;234-&quot;,psn_atr.value),MAX(IF(target.concept_id=159635, CONCAT(&quot;234-&quot;,obs.value_text), NULL)),MAX(IF(target.concept_id=164946, CONCAT(&quot;234-&quot;,obs.value_text), NULL))) AS PhoneNo,&#xd;\nCAST(person.birthdate AS DATE) AS DOB,&#xd;\nTIMESTAMPDIFF(YEAR,person.birthdate,CURDATE()) AS Age,&#xd;\nCAST(patient_program.date_enrolled AS DATE) AS EnrollmentDate,&#xd;\nIF(person.gender=&apos;F&apos;,MAX(IF(target.concept_id=165050, cn1.name, NULL)),null) AS  `PregnancyStatus`,&#xd;\nIF(person.gender=&apos;F&apos;,MAX(IF(target.concept_id=165050, CAST(target.last_date AS DATE), NULL)),null) AS  `PregnancyStatusDate`&#xd;\n,MAX(IF(target.concept_id=159599, @artStartDate:=CAST(obs.obs_datetime AS DATE), NULL)) AS  `ARTStartDate`&#xd;\n,MAX(IF(target.concept_id=164989, @lastPickupDate:=CAST(target.last_date AS DATE), NULL)) AS  `LastDrugPickUpDate`&#xd;\n,MAX(IF(target.concept_id=159368, obs.value_numeric, NULL)) AS  &#xd;\n`DaysOfARVRefill`&#xd;\n&#xd;\n,MAX(IF(target.concept_id=856,obs.value_numeric, NULL)) AS  `LastViralLoad`&#xd;\n,MAX(IF(target.concept_id=856,@lastViralLoadDate:=CAST(target.last_date AS DATE), NULL)) AS  `LastViralLoadDate`&#xd;\n,MAX(IF(obs.concept_id=159951,@lastSampleDate:=CAST(obs.obs_datetime AS DATE),null)) as LastSampleCollectionDate&#xd;\n,MAX(IF(target.concept_id=165708, cn1.name, NULL)) AS  ` LastRegimenLine`&#xd;\n,MAX(IF(target.concept_id=165708, CAST(target.last_date AS DATE), NULL)) AS  ` LastRegimenLineDate`&#xd;\n,MAX(IF(target.concept_id=164506,cn1.name, IF(target.concept_id=164507,cn1.name, NULL))) AS  `LastFirstLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164506,CAST(target.last_date AS DATE), IF(target.concept_id=164507,CAST(target.last_date AS DATE), NULL))) AS  `LastFirstLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=164513,cn1.name, IF(target.concept_id=164514,cn1.name, NULL)))  AS  `LastSecondLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164513,CAST(target.last_date AS DATE), IF(target.concept_id=164514,CAST(target.last_date AS DATE), NULL))) AS  `LastSecondLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id=164702,cn1.name, IF(target.concept_id=165703,cn1.name, NULL)))  AS  `LastThirdLineRegimen`&#xd;\n,MAX(IF(target.concept_id=164702,CAST(target.last_date AS DATE), IF(target.concept_id=165703,CAST(target.last_date AS DATE), NULL))) AS  `LastThirdLineRegimenDate`&#xd;\n,MAX(IF(target.concept_id= 165470,cn1.name, NULL)) AS  `LastPatientOutcome`&#xd;\n,MAX(IF(target.concept_id= 165470,CAST(target.last_date AS DATE), NULL)) AS  `LastPatientOutcomeDate`&#xd;\nFROM patient&#xd;\nLEFT JOIN patient_identifier pid1 ON(pid1.patient_id=patient .patient_id AND pid1.identifier_type=4 AND pid1.voided=0)&#xd;\nLEFT JOIN patient_identifier pid2 ON(pid2.patient_id=patient .patient_id AND pid2.identifier_type=5 AND pid2.voided=0)&#xd;\nLEFT JOIN person_address on(person_address.person_id=patient.patient_id and person_address.voided=0)&#xd;\nLEFT JOIN person_name pn3 ON(patient .patient_id=pn3.person_id AND pn3.voided=0)&#xd;\nLEFT JOIN person ON(person.person_id=patient .patient_id)&#xd;\nLEFT JOIN person_attribute psn_atr ON (person.person_id=psn_atr.person_id) &#xd;\nLEFT JOIN patient_program ON(patient_program.patient_id=person.person_id AND patient_program.voided=0)&#xd;\nLEFT JOIN&#xd;\n(&#xd;\nSELECT obs.person_id, obs.concept_id, MAX(obs.obs_datetime) AS last_date FROM obs where obs.voided=0 and obs.concept_id IN(159599,165050,856,165708,164506,164507,164513,164514,165702,165703,165470,164989,7778430,159951,159635,164946,159951,159368) GROUP BY obs.person_id, obs.concept_id)&#xd;\ntarget ON (target.person_id=patient.patient_id)&#xd;\nINNER JOIN obs ON(obs.person_id=target.person_id AND obs.concept_id=target.concept_id AND obs.obs_datetime=target.last_date AND obs.concept_id IN(159599,165050,856,165708,164506,164507,164513,164514,165702,165703,165470,164989,7778430,159951,159635,164946,159951,159368))&#xd;\nLEFT JOIN concept_name cn1 ON(obs.value_coded=cn1.concept_id AND cn1.locale=&apos;en&apos; AND cn1.locale_preferred=1)&#xd;\nwhere patient.voided=0&#xd;\nGROUP BY patient.patient_id&#xd;\nHAVING &#xd;\nTIMESTAMPDIFF(MONTH,MAX(IF(target.concept_id=164989,target.last_date, NULL)),curdate())&lt;5&#xd;\nAND&#xd;\nTIMESTAMPDIFF(MONTH,MAX(IF(target.concept_id=159599,obs.obs_datetime, NULL)),curdate())&gt;=6&#xd;\nAND&#xd;\nTIMESTAMPDIFF(MONTH,MAX(IF(target.concept_id=159951,obs.obs_datetime, NULL)),curdate())&gt;=12&#xd;\nAND&#xd;\n(&#xd;\n(&#xd;\nTIMESTAMPDIFF(MONTH,MAX(IF(target.concept_id=856,target.last_date, NULL)),curdate())&gt;=12&#xd;\nAND &#xd;\nMAX(IF(target.concept_id=856,obs.value_numeric, NULL))&lt;1000&#xd;\n)&#xd;\nOR&#xd;\n(&#xd;\nTIMESTAMPDIFF(MONTH,MAX(IF(target.concept_id=856,target.last_date, NULL)),curdate())&gt;=3&#xd;\nAND &#xd;\nMAX(IF(target.concept_id=856,obs.value_numeric, NULL))&gt;1000&#xd;\n)&#xd;\nOR&#xd;\nMAX(IF(target.concept_id=856,obs.value_numeric, NULL)) IS NULL&#xd;\n)</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-12-31 09:16:32', 1, '2019-12-31 09:16:39', 1, 0, NULL, NULL, NULL, '6e28b86e-dac2-4778-9780-1dc84855e44d'),
