(221, 'appointmentschedulingui.appointmentDataSetDefinition.dailyAppointments', 'appointmentschedulingui.appointmentDataSetDefinition.dailyAppointments', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.appointmentscheduling.reporting.dataset.definition.AppointmentDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.appointmentscheduling.reporting.dataset.definition.AppointmentDataSetDefinition id=\"1\" uuid=\"c1bf0730-e69e-11e3-ac10-0800200c9a66\" retired=\"false\">\n  <name>appointmentschedulingui.appointmentDataSetDefinition.dailyAppointments</name>\n  <description>appointmentschedulingui.appointmentDataSetDefinition.dailyAppointments</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2020-09-04 19:56:40 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged reference=\"3\"/>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>date</name>\n      <label>date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>location</name>\n      <label>location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>221</id>\n  <columnDefinitions id=\"7\">\n    <org.openmrs.module.reporting.dataset.column.definition.RowPerObjectColumnDefinition id=\"8\" uuid=\"fa1b5f09-8c9c-4dac-be9f-a7762175cf99\" retired=\"false\">\n      <name>identifier</name>\n      <parameters id=\"9\"/>\n      <dataDefinition id=\"10\">\n        <parameterizable class=\"org.openmrs.module.appointmentscheduling.reporting.data.definition.PatientToAppointmentDataDefinition\" id=\"11\" uuid=\"98029